const request = require('superagent')

class Request {

  async get(url, query = {}, type = 'json') {
    let res = await request
      .get(url)
      .query(query)
      .type(type)

    // console.log(res)
    if (res.status == 200) {
      return res.body
    } else {
      return null
    }
  }

  async post(url, data = {}, type = 'json') {

    let res = await request
      .post(url)
      .send(data)
      .type(type)

    // console.log(res)
    if (res.status == 200) {
      let ret = res.body
      console.log(ret)
      if (ret.code == -100 || ret.code == -101) {
        // this.dataHref('/auth/err?code=' + ret.code)
        this.jump(ret.code)
        ret.data = {}
        return ret
      }
      return res.body
    } else {
      return null
    }


  }

  jump(code) {

    if (code == -100) {
      if (window.android) {
        window.android.goToLogin();
      }
    }

    let html = `<div class="page bg-white">
    <div class="p-5 text-center">
      <span></span>`
    if (code == -100) {
      html += `<div>
          <span class="text-muted">授权失败</span>
        </div>
        <div>
          <hr>
          <small class="text-muted h1">请返回重新登录</small>
        </div>`
    } else if (code - 101) {
      html += `<p class="text-muted">您的账号还未通过审核，请耐心等待！</p>
        <hr>
        <p>若还未上传实名认证资料，请到 [我的] - [实名认证] 中上传真实资料信息</p>
        <a class="text-center">
          <a href="javascript:;" class="btn btn-outline-primary pl-5 pr-5">返回</a>
        </div>`
    }
    html += `</div>
      </div>`

    document.getElementById('err-bg').innerHTML = html
    document.getElementById('err-bg').style.display = 'block'

    document.getElementById('err-bg').onclick = () => {

      document.getElementById('err-bg').innerHTML = ''
      document.getElementById('err-bg').style.display = 'none';
      history.go(-1);
    }
  }


}

export default new Request

import Vue from 'vue'
import upperFirst from 'lodash/upperFirst'
import camelCase from 'lodash/camelCase'
import Reqeust from './api/common/request'
import App from './app.vue'

import {
  createRouter
} from './router'
import {
  createStore
} from './store'
import {
  sync
} from 'vuex-router-sync'


export function componentRegister() {
  // 组件的全局注册
  const requireComponent = require.context(
    // 其组件目录的相对路径
    './components',
    // 是否查询其子目录
    false,
    // 匹配基础组件文件名的正则表达式
    /[A-Z]\w+\.(vue|js)$/
  )
  // console.log('requireComponent  .........' , requireComponent.keys())
  requireComponent.keys().forEach(fileName => {

    // 获取组件配置
    const componentConfig = requireComponent(fileName)

    // 获取组件的 PascalCase 命名
    const componentName = upperFirst(
      camelCase(
        // 剥去文件名开头的 `'./` 和结尾的扩展名
        fileName.replace(/^\.\/(.*)\.\w+$/, '$1')
      )
    )

    // console.log('componentName .......' , componentName)
    // 全局注册组件
    Vue.component(
      componentName,
      // 如果这个组件选项是通过 `export default` 导出的，
      // 那么就会优先使用 `.default`，
      // 否则回退到使用模块的根。
      componentConfig.default || componentConfig
    )
  })
}


export function createApp() {
  // 创建 router 和 store 实例
  const router = createRouter()
  const store = createStore()

  // 同步路由状态(route state)到 store
  sync(store, router)

  const app = new Vue({
    router,
    store,
    render: h => h(App)
  })

  // app.$mount('#app')

  return { app , router , store }
}

